import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <ul>
          <li>CSS</li>
          <li>HTML</li>
          <li>REACT</li>
      </ul>
    </div>
  );
}
const App2 = () => {
    return (
        <div className="App">
            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>
        </div>
    );
}
export default App1;
